This operation should compute in *O*(1) time.

# Examples

```
#![feature(push_mut)]
use std::collections::LinkedList;

let mut dl = LinkedList::from([1, 2, 3]);

let ptr = dl.push_back_mut(2);
*ptr += 4;
assert_eq!(dl.back().unwrap(), &6);
```

